schema_content:
{
  "type": "object",
  "properties": {
    "id": {
      "type": "integer",
      "description": "Unique identifier"
    },
    "name": {
      "type": "string",
      "description": "Full name"
    },
    "email": {
      "type": "string",
      "format": "email",
      "description": "Email address"
    },
    "age": {
      "type": "integer",
      "minimum": 0,
      "maximum": 120,
      "description": "Age in years"
    },
    "active": {
      "type": "boolean",
      "description": "Account status"
    }
  },
  "required": [
    "id",
    "name",
    "email"
  ]
}
